import React, { useState, useContext } from "react";
import Compose from "./Compose";
import { NavLink } from "react-router-dom";
import { Context } from "./Mycontext";

export const Viandes = props => {
  const { nextTacos } = useContext(Context);
  return (
    <div className=" relative myFund container text-center flex-col rounded-xl  bg-white h-3/5 w-2/4 ">
      <Compose />

      <NavLink to="/sauces">
        <span className=" p-9 text-7xl" onClick={() => nextTacos(3)}>
          &#10093;
        </span>
      </NavLink>
    </div>
  );
};

export const Sauces = () => {
  const { nextTacos } = useContext(Context);
  return (
    <div className=" relative myFund container text-center flex-col rounded-xl  bg-white h-3/5 w-2/4 ">
      <Compose />
      <NavLink to="/sauces">
        <span className=" p-9 text-7xl" onClick={() => nextTacos(3)}>
          &#10093;
        </span>
      </NavLink>
    </div>
  );
};

export const Extra = () => {
  return (
    <li>
      <img
        src="./img/nav/1.png"
        alt="ok"
        className="w-20 h-20 flex justify-content-center items-center mx-auto"
      />
      <div className="flex mx-auto items-center">
        <span className="h-10 w-10 bg-green-800 px-4 py-2 mx-2 text-white">
          4
        </span>
        <h2>EXTRA</h2>
      </div>
    </li>
  );
};
